// Very ugly monkey patching D:
Scenes.LoadingScene = (function() {
  var M = cc.LoaderScene;
  var LABEL_COLOR = cc.color(255, 189, 0);
  var LABEL_BACK_COLOR = cc.color(255, 131, 0);
  M.prototype.init = function(){
    var self = this;
    var fontSize = 150;
    var label1 = self._label = self._label1 = new cc.LabelTTF("0%", "Berlin Sans FB Regular", fontSize);
    var label2 = self._label2 = new cc.LabelTTF("0%", "Berlin Sans FB Regular", fontSize);
    label1.setColor(LABEL_COLOR);
    label2.setColor(LABEL_BACK_COLOR);
    label1.setScale(0.23);
    label2.setScale(0.25);
    var shadowOffset = 1;
    label1.setPosition({x: cc.winSize.width*0.507, y: cc.winSize.height*0.145});
    label2.setPosition({x: cc.winSize.width*0.507, y: cc.winSize.height*0.145+shadowOffset});

    //logo
    var logoWidth = 160;
    var logoHeight = 200;

    // bg
    var bgLayer = self._bgLayer = new cc.LayerColor(cc.color(32, 32, 32, 255));
    self.addChild(bgLayer, 0);

    //image move to CCSceneFile.js
    var lblHeight =  -logoHeight / 2 + 100;
    if(cc._loaderImage){
      //loading logo
      cc.loader.loadImg(cc._loaderImage, {isCrossOrigin : false }, function(err, img){
        logoWidth = img.width;
        logoHeight = img.height;
        self._initStage(img, cc.visibleRect.center);
      });
      lblHeight = -logoHeight / 2 - 10;
    }
    cc.loader.loadImg("res/BerlinSansFBBold.ttf", {isCrossOrigin : false}, function() {
      //loading percent
      bgLayer.addChild(label2, 20);
      bgLayer.addChild(label1, 25);
    });
    return true;
  };

  M.prototype._startLoading = function () {
    var self = this;
    self.unschedule(self._startLoading);
    var res = self.resources;
    cc.loader.load(res,
      function (result, count, loadedCount) {
        var percent = (loadedCount / count * 100) | 0;
        percent = Math.min(percent, 100);
        self._label1.setString("" + percent + "%");
        self._label2.setString("" + percent + "%");
      }, function () {
        if (self.cb)
          self.cb.call(self.target);
      });
  };

  M.prototype._initStage = function (img, centerPos) {
    var self = this;
    var texture2d = self._texture2d = new cc.Texture2D();
    texture2d.initWithElement(img);
    texture2d.handleLoadedTexture();
    var logo = self._logo = new cc.Sprite(texture2d);
    var result = Lib.Math.expandInFrame({
      elementSize: {width: logo.width, height: logo.height},
      frameSize: cc.winSize
    });
    logo.setScale(result.scale);
    logo.x = centerPos.x;
    logo.y = centerPos.y;
    self._bgLayer.addChild(logo, 10);
  };

  return M;
}());
  cc._loaderImage = "data:image/png;base64,";
